import styled from "styled-components";

export const StyledLink = styled.a`
  margin-right: 15px;
  margin-bottom: 15px;
  font-size: 14px;
  line-height: 17px;
  padding: 8px 18px;
  border: 1px solid #ddd;
  border-radius: 50px;
  text-decoration: none;
  display: inline;
`;
